CREATE OR REPLACE FUNCTION drop_constraints(table_name_to_check varchar, column_name_to_check varchar) RETURNS integer AS $$
DECLARE
  con varchar;
  cnt integer;
BEGIN
  cnt := 0;
  FOR con IN (SELECT constraint_name FROM information_schema.constraint_column_usage WHERE table_catalog = 'axum' AND table_name = table_name_to_check AND column_name = column_name_to_check)
  LOOP 
    EXECUTE 'ALTER TABLE ' || table_name_to_check || ' DROP CONSTRAINT ' || con;
    cnt := cnt+1;
  END LOOP;
  RETURN cnt;
END
$$ LANGUAGE plpgsql;

SELECT drop_constraints('src_config', 'input_gain');

SELECT drop_constraints('src_preset', 'agc_amount');

-- Convert amoung(0-100%) to ratio (1:1-1:25)
ALTER TABLE src_preset
  ADD COLUMN agc_ratio float DEFAULT 1 CHECK (agc_ratio>=1 AND agc_ratio<=25);

UPDATE src_preset SET agc_ratio = CASE
                                    WHEN agc_amount = 100 THEN 25
                                    ELSE pow(2, (log(100/(100-agc_amount))/log(2.75))) 
                                  END;

ALTER TABLE src_preset
  DROP COLUMN agc_amount;

ALTER TABLE module_config
  ADD COLUMN agc_ratio float DEFAULT 1 CHECK (agc_ratio>=1 AND agc_ratio<=25);

UPDATE module_config SET agc_ratio = CASE
                                       WHEN agc_amount = 100 THEN 25
                                       ELSE pow(2, (log(100/(100-agc_amount))/log(2.75))) 
                                     END;

ALTER TABLE module_config
  DROP COLUMN agc_amount;


